n// framework\nimport { HttpCacheInterceptor } from '@app/interceptors/cache.interceptor'\nimport { ValidationPipe } from '@app/pipes/validation.pipe'\n\n// middlewares\nimport { CorsMiddleware } from '@app/middlewares/cors.middleware'\nimport { OriginMiddleware } from '@app/middlewares/origin.middleware'\n\n// universal modules\nimport { DatabaseModule } from '@app/processors/database/database.module'\nimport { CacheModule } from '@app/processors/cache/cache.module'\nimport { HelperModule } from '@app/processors/helper/helper.module'\n\n// BIZ helper module\nimport { ExpansionModule } from '@app/modules/expansion/expansion.module'\n\n// BIZ modules\nimport { AuthModule } from '@app/modules/auth/auth.module'\nimport { OptionModule } from '@app/modules/option/option.module'\nimport { AnnouncementModule } from '@app/modules/announcement/announcement.module'\nimport { TagModule } from '@app/modules/tag/tag.module'\nimport { CategoryModule } from '@app/modules/category/category.module'\nimport { ArticleModule } from '@app/modules/article/article.module'\nimport { CommentModule } from '@app/modules/comment/comment.module'\nimport { DisqusModule } from '@app/modules/disqus/disqus.module'\nimport { ArchiveModule } from '@app/modules/archive/archive.module'\nimport { VoteModule } from '@app/modules/vote/vote.module'\n\n@Module({\n  imports: [\n    // https://github.com/nestjs/throttler#readme\n    ThrottlerModule.forRoot({\n      ttl: 60 * 5, // 5 minutes\n      limit: 300, // 300 limit\n      ignoreUserAgents: [/googlebot/gi, /bingbot/gi, /baidubot/gi],\n    }),\n    HelperModule,\n    DatabaseModule,\n    CacheModule,\n    ExpansionModule,\n    // BIZs\n    AuthModule,\n    OptionModule,\n    AnnouncementModule,\n    TagModule,\n    CategoryModule,\n    ArticleModule,\n    CommentModule,\n    DisqusModule,\n    ArchiveModule,\n    VoteModule,\n  ],\n  controllers: [AppController],\n  providers: [\n    {\n      provide: APP_INTERCEPTOR,\n      useClass: HttpCacheInterceptor,\n    },\n    {\n      provide: APP_GUARD,\n      useClass: ThrottlerGuard,\n    },\n    {\n      provide: APP_PIPE,\n      useClass: ValidationPipe,\n    },\n  ],\n})\nexport class AppModule implements NestModule {\n  configure(consumer: MiddlewareConsumer) {\n    consumer.apply(CorsMiddleware, OriginMiddleware).forRoutes('*')\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"controllers/ArchiveController.html":{"url":"controllers/ArchiveController.html","title":"controller - ArchiveController","body":"\n                   \n\n\n\n\n\n\n  Controllers\n  ArchiveController\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/modules/archive/archive.controller.ts\n        \n\n            \n                Prefix\n            \n            \n                archive\n            \n\n\n\n\n\n\n            \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                getArchive\n                            \n                            \n                                updateArchive\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n            \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        getArchive\n                        \n                    \n                \n            \n            \n                \ngetArchive()\n                \n            \n\n            \n                \n                    Decorators : \n                    \n                    @Get()@('Get archive')\n                \n            \n\n            \n                \n                    Defined in src/modules/archive/archive.controller.ts:18\n                \n            \n\n\n            \n                \n\n                    \n                        Returns :         Promise\n\n                    \n                \n            \n        \n    \n    \n        \n            \n                \n                    \n                    \n                        updateArchive\n                        \n                    \n                \n            \n            \n                \nupdateArchive()\n                \n            \n\n            \n                \n                    Decorators : \n                    \n                    @Patch()@UseGuards(AdminOnlyGuard)@('Update archive cache')\n                \n            \n\n            \n                \n                    Defined in src/modules/archive/archive.controller.ts:25\n                \n            \n\n\n            \n                \n\n                    \n                        Returns :     Promise\n\n                    \n                \n            \n        \n    \n    \n\n\n    \n        /**\n * @file Archive controller\n * @module module/archive/controller\n * @author Surmon \n */\n\nimport { UseGuards, Controller, Get, Patch } from '@nestjs/common'\nimport { AdminOnlyGuard } from '@app/guards/admin-only.guard'\nimport { Responsor } from '@app/decorators/responsor.decorator'\nimport { ArchiveService, ArchiveData } from './archive.service'\n\n@Controller('archive')\nexport class ArchiveController {\n  constructor(private readonly archiveService: ArchiveService) {}\n\n  @Get()\n  @Responsor.handle('Get archive')\n  getArchive(): Promise {\n    return this.archiveService.getCache()\n  }\n\n  @Patch()\n  @UseGuards(AdminOnlyGuard)\n  @Responsor.handle('Update archive cache')\n  updateArchive(): Promise {\n    return this.archiveService.updateCache()\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/ArchiveData.html":{"url":"interfaces/ArchiveData.html","title":"interface - ArchiveData","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  \n  ArchiveData\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/modules/archive/archive.service.ts\n        \n\n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        \n                                            articles\n                                        \n                                \n                                \n                                        \n                                            categories\n                                        \n                                \n                                \n                                        \n                                            tags\n                                        \n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        articles\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        articles:         Article[]\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         Article[]\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        categories\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        categories:         Category[]\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         Category[]\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        tags\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        tags:         Tag[]\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         Tag[]\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import { Injectable } from '@nestjs/common'\nimport { InjectModel } from '@app/transformers/model.transformer'\nimport { CacheService, CacheIOResult } from '@app/processors/cache/cache.service'\nimport { MongooseModel } from '@app/interfaces/mongoose.interface'\nimport { SortType } from '@app/constants/biz.constant'\nimport { Category } from '@app/modules/category/category.model'\nimport {\n  Article,\n  ARTICLE_LIST_QUERY_GUEST_FILTER,\n  ARTICLE_LIST_QUERY_PROJECTION,\n} from '@app/modules/article/article.model'\nimport { Tag } from '@app/modules/tag/tag.model'\nimport * as CACHE_KEY from '@app/constants/cache.constant'\nimport logger from '@app/utils/logger'\n\nexport interface ArchiveData {\n  tags: Tag[]\n  categories: Category[]\n  articles: Article[]\n}\n\n@Injectable()\nexport class ArchiveService {\n  private archiveCache: CacheIOResult\n\n  constructor(\n    private readonly cacheService: CacheService,\n    @InjectModel(Tag) private readonly tagModel: MongooseModel,\n    @InjectModel(Article) private readonly articleModel: MongooseModel,\n    @InjectModel(Category) private readonly categoryModel: MongooseModel\n  ) {\n    this.archiveCache = this.cacheService.promise({\n      ioMode: true,\n      key: CACHE_KEY.ARCHIVE,\n      promise: this.getArchiveData.bind(this),\n    })\n    this.updateCache().catch((error) => {\n      logger.warn('[archive]', 'init getArchiveData Error:', error)\n    })\n  }\n\n  private getAllTags(): Promise {\n    return this.tagModel.find().sort({ _id: SortType.Desc }).exec()\n  }\n\n  private getAllCategories(): Promise {\n    return this.categoryModel.find().sort({ _id: SortType.Desc }).exec()\n  }\n\n  private getAllArticles(): Promise {\n    return this.articleModel\n      .find(ARTICLE_LIST_QUERY_GUEST_FILTER, ARTICLE_LIST_QUERY_PROJECTION)\n      .sort({ _id: SortType.Desc })\n      .exec()\n  }\n\n  private async getArchiveData(): Promise {\n    try {\n      return {\n        tags: await this.getAllTags(),\n        categories: await this.getAllCategories(),\n        articles: await this.getAllArticles(),\n      }\n    } catch (error) {\n      logger.warn('[archive]', 'getArchiveData Error:', error)\n      return {} as any as ArchiveData\n    }\n  }\n\n  public getCache() {\n    return this.archiveCache.get()\n  }\n\n  public updateCache() {\n    return this.archiveCache.update()\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules/ArchiveModule.html":{"url":"modules/ArchiveModule.html","title":"module - ArchiveModule","body":"\n                   \n\n\n\n\n    Modules\n    ArchiveModule\n\n\n\n    \n        \n\n\n\n\n\ndependencies\n\ndependencies\n\ncluster_ArchiveModule\n\n\n\ncluster_ArchiveModule_exports\n\n\n\ncluster_ArchiveModule_providers\n\n\n\n\nArchiveService \n\nArchiveService \n\n\n\nArchiveModule\n\nArchiveModule\n\nArchiveService  -->\n\nArchiveModule->ArchiveService \n\n\n\n\n\nArchiveService\n\nArchiveService\n\nArchiveModule -->\n\nArchiveService->ArchiveModule\n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            src/modules/archive/archive.module.ts\n        \n\n\n\n\n\n        \n     