thService  -->\n\nAuthModule->AuthService \n\n\n\n\n\nAuthService\n\nAuthService\n\nAuthModule -->\n\nAuthService->AuthModule\n\n\n\n\n\nJwtStrategy\n\nJwtStrategy\n\nAuthModule -->\n\nJwtStrategy->AuthModule\n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            src/modules/auth/auth.module.ts\n        \n\n\n\n\n\n        \n            \n                \n                    Providers\n                    \n                        \n                            AuthService\n                        \n                        \n                            JwtStrategy\n                        \n                    \n                \n                \n                    Controllers\n                    \n                        \n                            AuthController\n                        \n                    \n                \n                \n                    Exports\n                    \n                        \n                            AuthService\n                        \n                    \n                \n            \n        \n\n\n    \n\n\n    \n        /**\n * @file Auth module\n * @module module/auth/module\n * @author Surmon \n */\n\nimport jwt from 'jsonwebtoken'\nimport { Module } from '@nestjs/common'\nimport { JwtModule } from '@nestjs/jwt'\nimport { PassportModule } from '@nestjs/passport'\nimport { AuthController } from './auth.controller'\nimport { AuthProvider } from './auth.model'\nimport { AuthService } from './auth.service'\nimport { JwtStrategy } from './jwt.strategy'\nimport * as APP_CONFIG from '@app/app.config'\n\n@Module({\n  imports: [\n    PassportModule.register({ defaultStrategy: 'jwt' }),\n    JwtModule.register({\n      privateKey: APP_CONFIG.AUTH.jwtTokenSecret as jwt.Secret,\n      signOptions: {\n        expiresIn: APP_CONFIG.AUTH.expiresIn as number,\n      },\n    }),\n  ],\n  controllers: [AuthController],\n  providers: [AuthProvider, AuthService, JwtStrategy],\n  exports: [AuthService],\n})\nexport class AuthModule {}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/AuthService.html":{"url":"injectables/AuthService.html","title":"injectable - AuthService","body":"\n                   \n\n\n\n\n\n\n\n\n\n  Injectables\n  AuthService\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/modules/auth/auth.service.ts\n        \n\n\n\n\n\n            \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                    Public\n                                    Async\n                                adminLogin\n                            \n                            \n                                    Public\n                                createToken\n                            \n                            \n                                    Public\n                                    Async\n                                getAdminInfo\n                            \n                            \n                                    Private\n                                    Async\n                                getExistedPassword\n                            \n                            \n                                    Public\n                                    Async\n                                putAdminInfo\n                            \n                            \n                                    Public\n                               