// connect\n    this.cacheStore.client.connect()\n  }\n\n  public get(key: CacheKey): CacheResult {\n    if (!this.isReadied) {\n      return Promise.reject('Redis has not ready!')\n    }\n    return this.cacheStore.get(key)\n  }\n\n  public delete(key: CacheKey): CacheResult {\n    if (!this.isReadied) {\n      return Promise.reject('Redis has not ready!')\n    }\n    return this.cacheStore.del(key)\n  }\n\n  public set(\n    key: CacheKey,\n    value: any,\n    options?: {\n      /** seconds */\n      ttl: number\n    }\n  ): CacheResult {\n    if (!this.isReadied) {\n      return Promise.reject('Redis has not ready!')\n    }\n    return this.cacheStore.set(key, value, options)\n  }\n\n  /**\n   * @function promise\n   * @description  |  Promise -> Redis\n   * @example CacheService.promise({ key: CacheKey, promise() }) -> promise()\n   * @example CacheService.promise({ key: CacheKey, promise(), ioMode: true }) -> { get: promise(), update: promise() }\n   */\n  promise(options: CachePromiseOption): CacheResult\n  promise(options: CachePromiseIOOption): CacheIOResult\n  promise(options) {\n    const { key, promise, ioMode = false } = options\n\n    // \n    const doPromiseTask = async () => {\n      const data = await promise()\n      await this.set(key, data)\n      return data\n    }\n\n    // Promise \n    const handlePromiseMode = async () => {\n      const value = await this.get(key)\n      return value !== null && value !== undefined ? value : await doPromiseTask()\n    }\n\n    // \n    const handleIoMode = () => ({\n      get: handlePromiseMode,\n      update: doPromiseTask,\n    })\n\n    return ioMode ? handleIoMode() : handlePromiseMode()\n  }\n\n  /**\n   * @function interval\n   * @description  |  Promise -> Task -> Redis\n   * @example CacheService.interval({ key: CacheKey, promise(), timeout: {} }) -> promise()\n   * @example CacheService.interval({ key: CacheKey, promise(), timing: {} }) -> promise()\n   */\n  public interval(options: CacheIntervalOption): CacheIntervalResult\n  public interval(options: CacheIntervalIOOption): CacheIOResult\n  public interval(options) {\n    const { key, promise, timeout, timing, ioMode = false } = options\n\n    // \n    const promiseTask = async (): Promise => {\n      const data = await promise()\n      await this.set(key, data)\n      return data\n    }\n\n    // \n    if (timeout) {\n      const doPromise = () => {\n        promiseTask()\n          .then(() => {\n            setTimeout(doPromise, timeout.success)\n          })\n          .catch((error) => {\n            const time = timeout.error || timeout.success\n            setTimeout(doPromise, time)\n            logger.warn('[Redis]', `${time / 1000}s `, error)\n          })\n      }\n      doPromise()\n    }\n\n    // \n    if (timing) {\n      const doPromise = () => {\n        promiseTask()\n          .then((data) => data)\n          .catch((error) => {\n            logger.warn('[Redis]', `${timing.error / 1000}s `, error)\n            setTimeout(doPromise, timing.error)\n          })\n      }\n      doPromise()\n      schedule.scheduleJob(timing.schedule, doPromise)\n    }\n\n    // \n    const getKeyCache = () => this.get(key)\n\n    // \n    const handleIoMode = () => ({\n      get: getKeyCache,\n      update: promiseTask,\n    })\n\n    //  Redis \n    return ioMode ? handleIoMode() : getKeyCache\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/CacheService.html":{"url":"injectables/CacheService.html","title":"injectable - CacheService","body":"\n                   \n\n\n\n\n\n\n\n\n\n  Injectables\n  CacheService\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/processors/cache/cache.service.ts\n        \n\n\n\n\n\n            \n    Index\n    \n        \n                \n     